webpackJsonp([0x80f3a60d4d98],{1778:function(a,e){a.exports={data:{markdownRemark:{html:"<p>《过把瘾》一直放到一点多钟，这两集里开始发生矛盾，男人和女人的矛盾，丈夫和妻子的矛盾，解释得不错。生活中有很多矛盾，不是来自恨，而是来自爱。有时候来自爱的矛盾虽不如来自恨的矛盾厉害，可怜的是对来自爱的矛盾大部分人没有办法，只好在无穷的矛盾中消磨人性。人们往往不知道爱也会带来恨，这是很多的悲剧之所以发生的根本原因。</p>\n<p>排好参加《93中国发展报告》工作的有关人员的名单，大约有七十人左右，实在是庞大的队伍，也就是复旦大学能做到这样。这也显示了报告的力度。</p>\n<p>我的感觉是写一份这样的报告固然重要，但是在这个过程中培养队伍更加重要。</p>",id:"/home/swain/workspace/political-life/src/pages/zh/0023.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/zh/0023.md",frontmatter:{title:"2月2日 星期三"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/zh/0023.md absPath of file >>> MarkdownRemark"}}}});
